import s from './registrationPage.module.css'

const RegistrationPage = ()=>{
  return (
    <div className={s.registrationPage}>
      <div className={s.loginBlock}>
        <div className={s.nameOfBlock}> Log in</div>
        <div className={s.username}><input placeHolder="username" type="text" /></div>
        <div className={s.password}><input placeHolder="password" type="text" /></div>
        <div><button>Log in</button></div>
      </div>
      <hr />
      <div className={s.signUpBlock}>
        <div className={s.nameOfBlock}>Sign up</div>
        <div className={s.username}><input placeHolder="username" type="text" /></div>
        <div className={s.email}><input placeHolder="email" type="text" /></div>
        <div className={s.password}><input placeHolder="password" type="text" /></div>
        <div><button>Sign up</button></div>
      </div>
    </div>
  );
};

export default RegistrationPage;
